import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Material Components
import Grid from '@material-ui/core/Grid';
// Components
import ItemDetails from './ItemDetails';

const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  griditem: {
    padding: theme.spacing.unit * 2,
  }
});

function DataItemCard(props) {
  const { classes, data, dataGeneral } = props;

  return (
    <div>
      <Grid container justify="center" spacing={24}>
          {console.log(dataGeneral.type)}
        {data.map(data => (
          <Grid item xs={6} sm={4} className={classes.griditem}>
          {console.log(dataGeneral.type)}
            <ItemDetails 
              data={data}
              dataGeneral={dataGeneral}
            />
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

DataItemCard.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(DataItemCard);
